DROP TABLE IF EXISTS `t_p_listener`;
CREATE TABLE `t_p_listener` (
  `id` varchar(32) NOT NULL,
  `listenereven` varchar(20) default NULL COMMENT '触发调用任务监听器的任务事件的类型\ncreate：在任务被创建，且所有的任务属性被设置后发生。 \nassignment：在任务分配给某人后发生。注意：当流程执行到 userTask，在触发 create 事件之前，首先触\n发 assignment 事件。这像是一个反常的顺序，但原因很实际：接收到 create 事件，我们往往会要查看包括\n代理人在内的所有任务的属性。 \ncomplete：在任务完成后，任务从运行时的数据中被删除之前发生。',
  `listenertype` varchar(20) default NULL,
  `listenervalue` varchar(100) default NULL COMMENT '监听器表达式或类名',
  `listenername` varchar(50) default NULL COMMENT '监听器名称',
  `listenerstate` smallint(6) default NULL COMMENT '监听器状态\n1：启用\n2：禁用',
  `typeid` smallint(6) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

